import React, { useContext, useEffect, useRef, useState } from 'react';
import HeaderExample from './header';
import {
  Box,
  Button,  
  Header,  
  Grommet,
  Keyboard,  
  Main,
  ResponsiveContext,
  Tab,
  Tabs,
  Text,
  TextInput,
} from 'grommet';
import { hpe } from 'grommet-theme-hpe';



function App() {  
  return (
    <Grommet theme={hpe} full>
      <ResponsiveContext.Consumer>
        {size => (
          <AppContainer>
          <Box flex overflow="auto">
            <Box height={{ min: '100%' }}>
              <HeaderExample>               
              </HeaderExample>
              <Main
                fill={undefined}
                flex={false}
                pad="small"                
              >
                <Text weight="bold" color="text-strong">
                  Main
                </Text>
              </Main>
            </Box>
          </Box>
        </AppContainer>
        )}
      </ResponsiveContext.Consumer>
    </Grommet>
  );
}

export default App;
